import React from "react";

const Card=(props)=>{
    return(
<div class="container-fluid">
<div class="row">
<div class="col-12">
<h1 class="text-center">Profile Card</h1>
</div>
</div>
  <div class="row">
  <div class="col-lg-4 col-md-6 col-12">
    <div class="card" >
    <img class="card-img-top" src="img/card img/img_avatar1.png" alt="Card image"  />
    <div class="card-body">
    <div className='row'>
          {props.cardData
            ? props.cardData.map((d, i) => (
                <div key={`${d.name}-${i}`} className='col-xs-6 col-md-3'>
                  {' '}
                  
                  <h3>{d.name}</h3>
                  <p>{d.text}</p>
                </div>
              ))
            : 'Loading...'}
        </div>


      {/* <h4 class="card-title">{props.name}</h4>
      <p class="card-text">{props.text}</p> */}
      <a href="#" class="btn btn-primary">See Profile</a>
    </div>
  </div>
  </div>
</div>
</div>
    );
}

export default Card;
